import React from 'react';
import { Box, Typography } from '@mui/material';

const Analytics = () => {
    return (
        <Box>
            <Typography variant="h4" sx={{ fontWeight: 'bold', mb: 4 }}>Analytics</Typography>
            <Typography>Predictive analytics and advanced data views coming soon.</Typography>
        </Box>
    );
};

export default Analytics;
